import tw from "twin.macro"

export default function App() {
  return (
    <>
      <HTML />
    </>
  )
}

const HTML = () => {
  return (
    <>
      <h1>This is a h1</h1>
      <h2>This is a h2</h2>
      <h3>This is a h3</h3>
      <h4>This is a h4</h4>
      <h5>This is a h5</h5>
      <h6>This is a h6</h6>
      <p>This is a paragraph (p)</p>
      <div>
        This is a Div, commonly used as a container to position or layout other
        div/p/h/img/input/button within them.
      </div>
      <span>
        This is a span, commonly used to style text within a paragraph.
      </span>
      <ul>
        {/* [U]nordered [L]ist */}
        <li>This is a list item</li>
        <li>This is a list item</li>
        <li>This is a list item</li>
      </ul>
      <ol>
        {/* [O]rdered [L]ist */}
        <li>This is a list item</li>
        <li>This is a list item</li>
        <li>This is a list item</li>
      </ol>
      <button>This is a button</button>
      <input type="text" placeholder="This is an input" />
      <img src="https://picsum.photos/200" alt="200" />
    </>
  )
}

const WidthAndHeight = () => {
  return (
    <FullScreenWrapper>
      <Box1 />
      <Box2 />
      <Box3 />
      <Box4 />
    </FullScreenWrapper>
  )
}
const FullScreenWrapper = tw.div`w-screen h-screen`
const Box1 = tw.div`w-1/2 h-1/2 bg-green-500`
const Box2 = tw.div`w-1/3 h-1/3 bg-yellow-500`
const Box3 = tw.div`w-44 h-44 bg-blue-500`
const Box4 = tw.div`w-32 h-32 bg-red-500`

const Colors = () => {
  return <>Colors</>
}

const Margin = () => {
  return <>Margin</>
}

const Padding = () => {
  return <>Padding</>
}

const Flex = () => {
  return <>Flex</>
}

const Grid = () => {
  return <>Grid</>
}
